import React from 'react';

const CatatanTab = ({ formData, setFormData }) => {
  const handleChange = (e) => {
    setFormData({
      ...formData,
      catatan: e.target.value,
    });
  };

  return (
    <div className="mb-3">
      <label htmlFor="catatan" className="form-label">
        Catatan
      </label>
      <textarea
        id="catatan"
        className="form-control"
        rows="5"
        name="catatan"
        value={formData.catatan || ''}
        onChange={handleChange}
        placeholder="Masukkan catatan tambahan di sini..."
      />
    </div>
  );
};

export default CatatanTab;
